/**
 * @param {string} str1
 * @param {string} str2
 * @return {string}
 */
var gcdOfStrings = function(str1, str2) {
  for (let i = 0, length = str1.length; i < length; i++) {
      let tmp = str1.slice(0, i + 1),
          tmpReg = new RegExp(`${tmp}`, 'g'),
          tmpRes = str1.replace(tmpReg, '')
      
      if (tmpRes === '' && str2.replace(tmpReg, '') === '') {
          return tmp
      }
  }
  
  return ''
};

